import ExpenseItem from './ExpenseItem';

const ExpensesList = props => {
    if (props.expenses.length > 0)
    {
      expenseContent = props.expenses.map(expense => (
      <ExpenseItem
        title={expense.title}
        amount={expense.amount}
        date={expense.date}
        key={expense.id}
      />
    ))
    }
}

export default ExpensesList;
